import './App.css';
import NavBar from './NavBar'
import Main from './Main'
import Projects from './Projects'

function App() {
  return (
    <div className="App">
        <NavBar /> 
        <div className="MainDiv">
          <Main />
        </div>
        <div className="ProjectDiv">
          <Projects />
        </div>
    </div>
  );
}

export default App;
